import React from "react";
const Price=(props)=>{
return (
    <div class="columns">
    <ul class="price">
    <li class="header">{props.pack}</li>
    <li class="grey">`{props.rate} / Year`</li>
    <li>`{props.data} Storage`</li>
    <li>`{props.email} Email`</li>
    <li>`{props.domain} Domains`</li>
    <li>`{props.band} Bandwidth`</li>
    <li class="grey"><a href="#" class="button">Sign Up</a></li>
  </ul>
  </div>
)
}
export default Price;
